import React from 'react';
import './Game.css';
const Game = () => {
  return (
    <div className="hero w-full h-full bg-base-100 shadow-lg rounded-lg p-4">
      <div className="hero-content text-center">
        <div className="max-w-md">
          <h1 className="text-5xl font-bold">Game Lobby</h1>
          <p x-show="isOwner === 1" className="py-6">Please start the game when all players have joined.</p>
          <button x-show="isOwner === 1" className="btn btn-primary" onClick="sendStartMessage()">
            Start
          </button>
        </div>        
      </div>      
    </div>
  );

};

export default Game;
